import React, {useState, useEffect} from 'react';
import './App.css';
import Objective from "./components/Card/Objective.js";


function App() {
    const newObj = {
        "title": "Objective 3",
        "id": "3",
        "task": [{
            "id": "3",
            "title": "task1",
            "specific": "sasdad",
            "measurable": "ad",
            "achievable": "ads",
            "relevant": "asd",
            "status": "asd"
        }, {
            "id": "4",
            "title": "task2",
            "specific": "sasdad",
            "measurable": "ad",
            "achievable": "ads",
            "relevant": "asd",
            "status": "asd"
        }]
    }

    const state = useState([])
    const data = state[0];
    const setData = state[1];

    return (
        <div>
            <div className="content">
                {data.objective.map((objective, index) => {
                    return (<Objective key={objective.id} objective={objective}/>)
                })}
            </div>
            {console.log(JSON.stringify(state))}
            <div>
                <button onClick={() =>
                    setData({
                        ...data, data: {objective: [newObj]}
                    })}>Add objective</button>
            </div>
        </div>
    )
}

export default App;
